import React from 'react';





export default function CardActivity({name, difficulty, duration, season, countries}) {


//console.log();



  return (
    <div>
      <div>
        <h2>{name}</h2>
        <h2>{difficulty}</h2>
        <h2>{duration}</h2>
        <h2>{season}</h2>
        <h2>{countries}</h2>
      </div>
    </div>
  )
};
